import React from 'react';
import Link from 'next/link'
import { Button } from 'antd';
import { useSelector } from 'react-redux';

const Home = () => {

    const { allPosts } = useSelector(state => state.post);

    return (
    <>
        <div>{allPosts.map(v => {
            return (
                <PostCard key={v} post={v}/>
            )
        })}</div>    
    </>)
}

export default Home;
